    "sourceText": "md`\n### pack()\nParameter|Default|Type\n---|---|---\n{size}||Pair of numbers [width, height]\n{pageMargin}|5|Number of mm to reserve around the edge of the page\n{itemMargin}|1|Number of mm to reserve around each item on the page\n{perLayout}|Infinity|Maximum number of shapes per page\npackSize|[]|Array of [width, height] filled in with the width and height decided by pack\n\nPacks a number of shapes into a page.\n\nThe page may have a provided size, otherwise it will be considered unlimited.\n\nIf packing exceeds the capacity of a page, it will spill over onto another page.\n\nThese pages may be packed as items, or downloaded as a series.\n\nThe packaged page is an item, accessing the content will require using in().\n\nSee: [in](#https://raw.githubusercontent.com/jsxcad/JSxCAD/master/nb/api/in.nb)\n`;",

    const prepareViews = async (notebook) => {
      // Prepare the view urls in the browser.
      for (const note of notebook) {
        if (note.view && !note.url) {
          note.url = await dataUrl(Shape.fromGeometry(note.data), note.view);
        }
      }
      return notebook;
    }

    const run = async () => {
      const body = document.getElementsByTagName('body')[0];
      const bookElement = document.createElement('div');
      const notebookElement = await toDomElement(await prepareViews(notebook));
      bookElement.appendChild(notebookElement);
      body.appendChild(bookElement);
      bookElement.classList.add('book', 'notebook', 'loaded');
    };

    if (document.readyState === 'complete') {
      run();
    } else {
      document.onreadystatechange = () => {
        if (document.readyState === 'complete') {
          run();
        }
      };
    }
  </script>
